    "2015-11-18T09:34:34.671324",nt"name": "u-s-forest-service-surface-ownership",nt"isopen":
    true,nt"url": null,nt"notes": "A map service on the www depicting ownership
    parcels of the surface estate. Each surface ownership parcel is tied to a particular
    legal transaction. The same individual or organization may currently own many parcels
    that may or may not have been acquired through the same legal transaction. Therefore,
    they are captured as separate entities rather than merged together. Surface Ownership
    provides the land status user with a current snapshot of ownership within National
    Forest boundaries. The purpose of the data is to provide display, identification,
    and analysis tools for determining current boundary information for Forest Service
    managers, GIS Specialists, and others.",nt"license_title": "Creative Commons
